import react from "react";
import styled from "styled-components"
import Button from '@material-ui/core/Button';
import SiteProjeto from '../imagens/site-gif.gif'
import Labefy from '../imagens/labefy.gif'

const ImgProject = styled.img`
  height: 200px;
  width: 300px;
  object-fit: cover;
  @media (max-width: 650px) {
    width: 100%;
    height: 200px;
  }
`


class Projetos extends react.Component{
    render(){
        return(
            <div>
            <p><strong>Projeto:</strong> {this.props.nomeProjeto}</p>
            <p><strong>Descricao do projeto:</strong>{this.props.descricaoProjeto}</p>
            <p><strong>Feito em: </strong>{this.props.requisitosProjeto}</p>
            <ImgProject src={this.props.imagem}/>
        </div>
        )
    }

}

export default Projetos
